import React from 'react';
import { useGlobalContext } from "./starwars"

const pagination = () => {
    const { page, nbPages } = useGlobalContext();

    return (
        <>
            <div className='pagination_btn'>
                <button onClick={() => getPrevPage()}>PREV</button>
                <p>
                    {page} of {nbPages}
                </p>
                <button onClick={() => getNextPage}></button>
            </div>

        </>
    )
};

